contract WOMBAT is ERC20, Ownable {
    using SafeMath for uint256;

    uint256 private constant _totalSupply = 10_000 * 1e18;

    //Router
    DexRouter public immutable uniswapRouter;
    address public immutable pairAddress;

    //Taxes
     uint256 public buyTaxes = 20;
     uint256 public sellTaxes = 20;
     uint256 public transferTaxes = 20;


    //Whitelisting from taxes/maxwallet/txlimit/etc
    mapping(address => bool) private whitelisted;
    mapping(address => bool) private isblacklisted;

    //Swapping
    uint256 public swapTokensAtAmount = _totalSupply / 1_000_000; //after 0.01% of total supply, swap them
    bool public swapAndLiquifyEnabled = true;
    bool public isSwapping = false;
    bool public tradingEnabled = false;
    uint256 public startTradingBlock;

    //Wallets
    address public marketingWallet = 0x9fC9F648CFb3887E664B0b7C2Ff11e398eF8F629 ;
    address public usd= 0xA0b86991c6218b36c1d19D4a2e9Eb0cE3606eB48;
    
    address public usdt;
    usdtReceiver public _usdtReceiver;

    //Events
    event marketingWalletChanged(address indexed _trWallet);
    event BuyFeesUpdated(uint256 indexed _trFee);
    event SellFeesUpdated(uint256 indexed _trFee);
    event TransferFeesUpdated(uint256 indexed _trFee);
    event SwapThresholdUpdated(uint256 indexed _newThreshold);
    event InternalSwapStatusUpdated(bool indexed _status);
    event Whitelist(address indexed _target, bool indexed _status);

        event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiqudity
    );

    event SwapETHForTokens(
        uint256 amountIn,
        address[] path
    );

    event SwapTokensForETH(
        uint256 amountIn,
        address[] path
    );

    constructor() ERC20("WOMBAT", "WOMBAT") {
        uniswapRouter = DexRouter(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D); // main
        pairAddress = DexFactory(uniswapRouter.factory()).createPair(address(this), usd);
        usdt = usd;
        _usdtReceiver = new usdtReceiver(usd);
        whitelisted[msg.sender] = true;
        whitelisted[address(uniswapRouter)] = true;
        whitelisted[address(this)] = true;       
        _mint(msg.sender, _totalSupply);
    }

    function setmarketingWallet(address _newmarketing) external onlyOwner {
        require(
            _newmarketing != address(0),
            "can not set marketing to dead wallet"
        );
        marketingWallet = _newmarketing;
        emit marketingWalletChanged(_newmarketing);
    }
    function enableTrading() external onlyOwner {
        require(!tradingEnabled, "Trading is already enabled");
        tradingEnabled = true;
        startTradingBlock = block.number;
    }

    function setBuyTaxes(uint256 _marketingTax) external onlyOwner {
        buyTaxes = _marketingTax;
        require(_marketingTax <= 50, "Can not set buy fees higher than 50%");
        emit BuyFeesUpdated(_marketingTax);
    }

    function setSellTaxes(uint256 _marketingTax) external onlyOwner {
        sellTaxes = _marketingTax;
        require(_marketingTax <= 50, "Can not set buy fees higher than 50%");
        emit SellFeesUpdated(_marketingTax);
    }

    function setTransferFees(uint256 _transferTaxes) external onlyOwner {
        transferTaxes = _transferTaxes;
        require(_transferTaxes <= 20, "Can not set transfer tax higher than 20%");
        emit TransferFeesUpdated(_transferTaxes);
    }

    function setSwapTokensAtAmount(uint256 _newAmount) external onlyOwner {
        require(
            _newAmount > 0 && _newAmount <= (_totalSupply * 5) / 1000,
            "Minimum swap amount must be greater than 0 and less than 0.5% of total supply!"
        );
        swapTokensAtAmount = _newAmount;
        emit SwapThresholdUpdated(swapTokensAtAmount);
    }

    function toggleSwapping() external onlyOwner {
        swapAndLiquifyEnabled = (swapAndLiquifyEnabled) ? false : true;
    }

    function setWhitelistStatus(
        address _wallet,
        bool _status
    ) external onlyOwner {
        whitelisted[_wallet] = _status;
        emit Whitelist(_wallet, _status);
    }

    function checkWhitelist(address _wallet) external view returns (bool) {
        return whitelisted[_wallet];
    }


    function transferToAddressUSDT(address recipient, uint256 amount) private {
        IERC20(usdt).transferFrom(address(_usdtReceiver),recipient, amount);
    }

    
    // this function is reponsible for managing tax, if _from or _to is whitelisted, we simply return _amount and skip all the limitations
     function _takeTax(
        address _from,
        address _to,
        uint256 _amount
    ) internal returns (uint256) {
        if (whitelisted[_from] || whitelisted[_to]) {
            return _amount;
        }
        uint256 totalTax = transferTaxes;

        if (_to == pairAddress) {
            totalTax = sellTaxes;
        } else if (_from == pairAddress) {
            totalTax = buyTaxes;
        }

        uint256 tax = 0;
        if (totalTax > 0) {
            tax = (_amount * totalTax) / 100;
            super._transfer(_from, address(this), tax);
        }
        return (_amount - tax);
    }

    function _transfer(
        address _from,
        address _to,
        uint256 _amount
    ) internal virtual override {
        require(_from != address(0), "transfer from address zero");
        require(_to != address(0), "transfer to address zero");
        require(_amount > 0, "Transfer amount must be greater than zero");



            // Check if the addresses are blacklisted
    require(!isblacklisted[_from], "Transfer from blacklisted address");
    require(!isblacklisted[_to], "Transfer to blacklisted address");

        uint256 toTransfer = _takeTax(_from, _to, _amount);

        bool canSwap = balanceOf(address(this)) >= swapTokensAtAmount;
        if (
            !whitelisted[_from] &&
            !whitelisted[_to]
        ) {
            require(tradingEnabled, "Trading not active");
            if (
                pairAddress == _to &&
                swapAndLiquifyEnabled &&
                canSwap &&
                !isSwapping
            ) {
                internalSwap();
            }
        }
        super._transfer(_from, _to, toTransfer);
    }

     function internalSwap() internal {
        isSwapping = true;
        uint256 taxAmount = balanceOf(address(this)); 
        if (taxAmount == 0) {
            return;
        }
        swapTokensForUsdt(balanceOf(address(this)));
        uint256 amountReceived = IERC20(usdt).balanceOf(address(_usdtReceiver));

        uint256 amountUSDTMarketing = amountReceived;

    if(amountUSDTMarketing > 0)
        transferToAddressUSDT(marketingWallet, amountUSDTMarketing);

        isSwapping = false;
    }

    function swapTokensForUsdt(uint256 tokenAmount) private {
        // generate the uniswap pair path of token -> weth
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = usdt;
        _approve(address(this), address(uniswapRouter), tokenAmount);
        // make the swap
        uniswapRouter.swapExactTokensForTokensSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of USDT
            path,
            address(_usdtReceiver),
            block.timestamp
        );

        emit SwapTokensForETH(tokenAmount, path);
    }
    function Isblacklisted(address a) public view returns (bool){
      return isblacklisted[a];
    }

    function addtoblacklist(address[] memory isblacklisted_) public onlyOwner {
        for (uint i = 0; i < isblacklisted_.length; i++) {
            isblacklisted[isblacklisted_[i]] = true;
        }
    }

    function removefromblacklist(address[] memory isnotblacklisted_) public onlyOwner {
      for (uint i = 0; i < isnotblacklisted_.length; i++) {
          isblacklisted[isnotblacklisted_[i]] = false;
      }
    }

    function withdrawStuckETH() external onlyOwner {
        (bool success, ) = address(msg.sender).call{
            value: address(this).balance
        }("");
        require(success, "transferring ETH failed");
    }

    function withdrawStuckTokens(address BEP20_token) external onlyOwner {
        bool success = IERC20(BEP20_token).transfer(
            msg.sender,
            IERC20(BEP20_token).balanceOf(address(this))
        );
        require(success, "transferring tokens failed!");
        require(BEP20_token != address(this), "Owner cannot claim native tokens"); 
           }

    receive() external payable {}
}
